                  Wanna Chat?
                </button>
              </div>
            )}
          </div>
        ) : (
          <div className="custm_top">
            <div className="title">
              <span>welcome {this.props.location.state[0].name}!!</span>
            </div>
            {this.state.profile ? (
              <div className="container">
